import React from 'react';
import './card.css';

function Card(props) {
  return (
    <div className="card" style={{ width: '18rem', backgroundImage: `linear-gradient(to right, rgba(245, 246, 252, 0.52), ${props.firstColor}, url('${props.image}') no-repeat !important;` }}>
      <div className="card-body">
        <strong className="card-title">Card title</strong>
        <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
      </div>
    </div>
  );
}

export default Card;
